!function(t){t("#toggle-status").on("click",function(e){e.preventDefault(),t.ajax({method:"post",url:api_vars.rest_url+"wp/v2/posts/"+api_vars.post_id,data:{post_status:"draft"},beforeSend:function(t){t.setRequestHeader("X-WP-Nonce",api_vars.wpapi_nonce)}}).done(function(t){alert("Success! Status changed")})})}(jQuery);